import React from 'react';

const Navbar = ({ feedURLs, onSelectFeed }) => {
  return (
    <nav>
      <ul>
        {feedURLs.map((url, index) => (
          <li
            key={index}
            onClick={() => onSelectFeed(url)}>{url}
            
          </li>
        ))}
      </ul>
    </nav>
  );
};

export default Navbar;
